import React, { Component } from "react";
import { Bar } from "react-chartjs-2";

class MarksBarChart extends Component {
  render() {
    const { data } = this.props;

    const options = {
      scales: {
        y: {
          beginAtZero: true,
        },
      },
    };

    return <Bar data={data} options={options} />;
  }
}

export default MarksBarChart;
